import React from 'react';
import { Button } from 'react-bootstrap';

interface IServiceCardProps {
  id: number;
  title: string;
  subtitle: string;
  description: string;
  backgroundImage: string;
}

const ServiceCard: React.FC<IServiceCardProps> = ({ id, title, subtitle, description, backgroundImage }) => {
  return (
    <div
  style={{
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    height: '100%',
    position: 'relative',
    color: '#fff',
    borderRadius: '8px',
    overflow: 'hidden',
  }}
>
  <div style={{
    position: 'absolute',
    bottom: 0,
    width: '100%',
    background: 'rgba(0,0,0,0.6)',
    padding: '20px',
  }}>
    <h3>{title}</h3>
    <p>{subtitle}</p>
    <p>{description}</p>
    <div style={{ display: 'flex', gap: '10px' }}>
      <Button style={{ backgroundColor: '#FF6B6B', borderColor: '#FF6B6B' }}>Мне это интересно</Button>
      <Button style={{ backgroundColor: '#007bff', borderColor: '#007bff' }}>Подробнее</Button>
    </div>
  </div>
</div>

  );
};

export default ServiceCard;
